    @Nullable
    private static List<String> getKlines(String code, String url) {
        String data = getDataString(url);
        GpInfoResultBase<GpInfoResult> baseData = JsonUtils.parseObject(data, new TypeReference<>() {
        });
        if (baseData == null || null == baseData.getData()) {
            log.error("获取数据失败，code：{},返回结果：{}", code, data);
            return null;
        }
        return baseData.getData().getKlines();
    }

    /**
     * 基础校验
     *
     * @param gpInfoVo 对象
     * @return true 校验不通过 false 校验通过
     */
    public static boolean checkBase(final GpInfoVo gpInfoVo) {
        return checkBase(gpInfoVo, 3);
    }

    /**
     * 基础校验
     *
     * @param gpInfoVo 对象
     * @return true 校验不通过 false 校验通过
     */
    public static boolean checkBase(final GpInfoVo gpInfoVo, int days) {
        if (checkDate(gpInfoVo, days)) {
            return true;
        }
        return null == gpInfoVo.getF2() || null == gpInfoVo.getMa20();
    }

    /**
     * 校验最新成交时间不能和当前时间相差指定天数
     *
     * @param gpInfoVo 对象
     * @param days     时间
     * @return true 校验不通过 false 校验通过
     */
    public static boolean checkDate(final GpInfoVo gpInfoVo, int days) {
        // 校验时间不能和当天差值超过3天
        int czDate = DateUtils.differentDaysByMillisecond(new Date(), DateUtils.parseDate(gpInfoVo.getInfoDate()));
        return czDate > days;
    }

    /**
     * 校验20日均价和当前价上下浮动1%
     *
     * @param gpInfoVo 对象
     * @return true 校验不通过 false 校验通过
     */
    public static boolean checkMa20(final GpInfoVo gpInfoVo, BigDecimal bl) {
        BigDecimal ma20abs = gpInfoVo.getF2().subtract(gpInfoVo.getMa20()).abs();
        BigDecimal ma20divide = ma20abs.divide(gpInfoVo.getMa20(), 3, RoundingMode.HALF_UP);
        return ma20divide.compareTo(bl) > 0;
    }
